void Update() {
	while (ejecutar) {
		ImprimirPantalla();
		//entre estos comentarios va lolas funcionalidades de el juego
		Inputs();
		Logica();
		//
		ClearScreen();
	}
	
}
void ImprimirPantalla() {
	for (int i = 0; i < CONSOLE_HEIGHT; i++)
	{
		for (int j = 0; j < CONSOLE_WIDTH; j++)
		{
			if (personaje_y == i && personaje_x == j) {
				PrintPersonaje();
			}
			else {
				SetConsoleTextAttribute(GetStdHandle(STD_OUTPUT_HANDLE), FOREGROUND_BLUE);
				cout << (char)ConsoleScreen[i][j];
			}

		}
		cout << endl;
	}
}
void Inputs() {
	//sirve para que se mueva automaticamente sin pulsar nada
	/*if (_kbhit()) {
			input = toupper(_getch());
		}*/
	char input = toupper(_getch());
	cout << input;
	switch (input)
	{
	case 'H':
	case 'W':
		inputs = INPUTS::UP;
		break;
	case 'A':
	case 'K':
		inputs = INPUTS::LEFT;
		break;
	case 'S':
	case 'P':
		inputs = INPUTS::DOWN;
		break;
	case 'M':
	case 'D':
		inputs = INPUTS::RIGHT;
		break;
	case 'Q':
		inputs = INPUTS::QUIT;
		break;
	default:
		inputs = INPUTS::NONE;
		break;
	}
}
void Logica() {
	switch (inputs)
	{
	case NONE:
		break;
	case UP:
		personaje_y--;
		if (personaje_y == -1) {
			switch (personaje_x) {
				//hueco1
			case 25:
				personaje_y = CONSOLE_HEIGHT - 1;
				break;
			case 26:
				personaje_y = CONSOLE_HEIGHT - 1;
				break;
				//hueco 2
			case 52:
				personaje_y = CONSOLE_HEIGHT - 1;
				personaje_x = 66;
				break;
				//hueco 3
			case 66:
				personaje_y = CONSOLE_HEIGHT - 1;
				personaje_x = 52;
				break;
				//hueco 4
			case 92:
				personaje_y = CONSOLE_HEIGHT - 1;
				break;
			case 93:
				personaje_y = CONSOLE_HEIGHT - 1;
				break;
			}
		}
		if (ConsoleScreen[personaje_y][personaje_x] == MAP_TILES::WALL) {
			personaje_y++;
		}
		break;
	case DOWN:
		personaje_y++;
		if (personaje_y == CONSOLE_HEIGHT) {
			switch (personaje_x) {
				//hueco1
			case 25:
				personaje_y = 0;
				break;
			case 26:
				personaje_y = 0;
				break;
				//hueco 2
			case 52:
				personaje_y = 0;
				personaje_x = 66;
				break;
				//hueco 3
			case 66:
				personaje_y = 0;
				personaje_x = 52;
				break;
				//hueco 4
			case 92:
				personaje_y = 0;
				break;
			case 93:
				personaje_y = 0;
				break;
			}
		}
		if (ConsoleScreen[personaje_y][personaje_x] == MAP_TILES::WALL) {
			personaje_y--;
		}
		break;
	case RIGHT:
		personaje_x++;
		if (personaje_x == CONSOLE_WIDTH - 1) {
			switch (personaje_y)
			{
			case 10:
				personaje_x = 0;
				break;
			case 18:
				personaje_x = 0;
				break;
			}
		}
		if (ConsoleScreen[personaje_y][personaje_x] == MAP_TILES::WALL) {
			personaje_x--;
		}
		break;
	case LEFT:
		personaje_x--;
		if (personaje_x == -1) {
			switch (personaje_y)
			{
			case 10:
				personaje_x = CONSOLE_WIDTH - 1;
				break;
			case 18:
				personaje_x = CONSOLE_WIDTH - 1;
				break;
			}
		}
		if (ConsoleScreen[personaje_y][personaje_x] == MAP_TILES::WALL) {
			personaje_x++;
		}
		break;
	case QUIT:
		ejecutar = false;
		break;
	default:
		break;
	}
}
void PrintPersonaje() {
	SetConsoleTextAttribute(GetStdHandle(STD_OUTPUT_HANDLE), 0x6);
	cout << personaje;
	return;
}
void ClearScreen()
{
	COORD cursorPosition;	cursorPosition.X = 0;	cursorPosition.Y = 0;	SetConsoleCursorPosition(GetStdHandle(STD_OUTPUT_HANDLE), cursorPosition);
}